import React, { useState } from 'react';
import { FaBars, FaFileAlt, FaSignOutAlt, FaUser } from 'react-icons/fa';

const Soal = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [hasCompletedExam1, setHasCompletedExam1] = useState(false);
  const [showConfirmation, setShowConfirmation] = useState(false);
  const [showNotification, setShowNotification] = useState(false);
  const [notificationMessage, setNotificationMessage] = useState('');
  const [selectedExam, setSelectedExam] = useState('');

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  const checkExamCompletion = (ujianName) => {
    if (!hasCompletedExam1) {
      showNotificationMessage("Anda belum mengerjakan Ujian 1");
    } else {
      setSelectedExam(ujianName);
      setShowConfirmation(true);
    }
  };

  const showNotificationMessage = (message) => {
    setNotificationMessage(message);
    setShowNotification(true);
  };

  const startExam = () => {
    alert("Anda memulai " + selectedExam);
    setShowConfirmation(false);
    // Tambahkan logika untuk memulai ujian di sini
  };

  return (
    <div className="flex min-h-screen bg-gray-100">
      <div className={`sidebar bg-blue-500 flex flex-col items-center justify-between py-5 px-0 fixed left-10 top-1/2 transform -translate-y-1/2 h-[95%] ${sidebarOpen ? 'w-56' : 'w-14'} rounded-lg transition-all duration-300`}>
        <a href="#" className="toggle-btn mb-5" onClick={toggleSidebar}>
          <FaBars className="text-white text-2xl" />
        </a>
        <a href="soal.js" className="nav-item flex items-center justify-start w-full py-2 px-4 mb-5 text-white transition-colors duration-300">
          <FaFileAlt className="text-2xl mr-2" />
          <span className={`nav-text ${sidebarOpen ? 'block' : 'hidden'} text-base`}>Soal Ujian</span>
        </a>
        <a href="registration" className="nav-item logout mt-auto flex items-center justify-start w-full py-2 px-4 text-white transition-colors duration-300">
          <FaSignOutAlt className="text-2xl mr-2" />
          <span className={`nav-text ${sidebarOpen ? 'block' : 'hidden'} text-base`}>Logout</span>
        </a>
      </div>

      <div className="container flex-1 ml-20 p-10">
        <h2 className="text-3xl mb-6">Soal Ujian</h2>

        <div className="absolute top-5 right-12 mt-6 ml-5">
          <FaUser className="text-2xl" />
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {['Ujian 1', 'Ujian 2', 'Ujian 3', 'Ujian 4'].map((ujian, index) => (
            <div key={index} className="card bg-white p-6 rounded-lg shadow-md">
              <h3 className="text-xl font-bold mb-2">{ujian}</h3>
              <p>Waktu: 60 Menit<br />Jumlah Soal: 50</p>
              <button className="mt-4 bg-black text-white py-2 px-4 rounded hover:bg-gray-800" onClick={() => checkExamCompletion(ujian)}>Mulai</button>
            </div>
          ))}
        </div>
      </div>

      {showConfirmation && (
        <div className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-50">
          <div className="bg-white rounded-lg p-5 text-center">
            <h3 className="text-lg font-bold mb-3">Apakah Anda ingin memulai ujian?</h3>
            <div>
              <button className="bg-green-500 text-white px-4 py-2 rounded mr-2" onClick={startExam}>Ya</button>
              <button className="bg-red-500 text-white px-4 py-2 rounded" onClick={() => setShowConfirmation(false)}>Tidak</button>
            </div>
          </div>
        </div>
      )}

      {showNotification && (
        <div className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-50">
          <div className="bg-white rounded-lg p-5 text-center">
            <h3 className="text-lg font-bold mb-3">{notificationMessage}</h3>
            <button className="bg-blue-500 text-white px-4 py-2 rounded" onClick={() => setShowNotification(false)}>OK</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Soal;
